import React from "react";
import backgroundimage from "./images/kelli-mcclintock-wBgAVAGjzFg-unsplash.jpg";

function Dashboard() {
  return (
    <div>
      {/* Background Image Section */}
      <div
        className="h-screen md:h-[80vh] flex flex-col justify-center items-center"
        style={{
          backgroundImage: `url(${backgroundimage})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        <div className="text-center px-4 md:px-0">
          <h1 className="text-white text-2xl md:text-4xl lg:text-6xl font-bold shadow-lg">
            THE HOME OF MILITARY MENTAL HEALTH
          </h1>
        </div>
      </div>

      {/* Mission Section */}
      <div className="py-10 bg-slate-50">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <h1 className="text-3xl font-bold mb-5">Our Mission</h1>
          <p className="text-base md:text-lg">
            The Lemich Clinic for Military Mental Health was founded on the
            belief that everyone who serves should have access to high-quality,
            confidential, mental health care. The majority of our clients are
            active duty sailors at Naval Station Norfolk. We also see service
            members from the other military installations in Virginia. We also
            work with military spouses and recent veterans. If you are a first
            responder or outside the military, contact us to see if you qualify
            for our program.
          </p>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
